(1, 'SPORTSFEST', '2024-08-07 10:00:00', 'Sports Fest is a gathering where people compete or participate in sports, possibly for trophies or awards. It is where people can showcase their talents in different sporting events. Most Sports Fest events happen in schools as it is where the students can take an academic break and have a day or week doing physical activities such as playing sports. But, most establishments or companies organize are starting to organize Sports Fest events for their employees.', , 0, 0, 0, '2024-06-30 09:13:20');
INSERT INTO `event` (`event_id`, `title`, `schedule`, `description`, `image`, `going`, `interested`, `not_interested`, `date_created`) VALUES
(2, 'ALUMNI GATHERING', '2024-08-08 07:00:00', 'Alumni events are often focused on team building, and scavenger hunts are one of the best team-building activities. The aim of a scavenger hunt is to work together, collaborate, and solve a problem. They’re loads of fun, and they encourage your alumni to utilize their skills and expertise. \r\n\r\nThere is a range of scavenger hunts that you could run. These include dedicated scavenger hunt rooms, organized scavenger hunt events, and even online scavenger hunts – which can be great for virtual alumni networking. ', , 0, 0, 0, '2024-06-30 09:13:20');
INSERT INTO `event` (`event_id`, `title`, `schedule`, `description`, `image`, `going`, `interested`, `not_interested`, `date_created`) VALUES
(5, 'EDUCATIONAL ASSISTANCE', '2024-07-10 07:00:00', 'The Following List Of Names Of Students Are Those Who Have Applied And Completed The Requirements That Are Needed For The Grant, This Has Been Evaluated And Thoroughly Screened By The Staff Of The PSP Office. For Questions Or Inquiries, You May Visit The OSAS Office Or Email Ms. Karen Tilan - (karen.tilan@cvsu.edu. Ph) For Inquiries.', , 0, 0, 0, '2024-06-30 12:57:25');

